public class InnerStorageLensBucketLevelFactory(Action<Humidifier.S3.StorageLensTypes.BucketLevel> factoryAction = null) : SubResourceFactory<Humidifier.S3.StorageLensTypes.BucketLevel>
{

    internal InnerStorageLensAdvancedDataProtectionMetricsFactory AdvancedDataProtectionMetricsFactory { get; set; }

    internal InnerStorageLensPrefixLevelFactory PrefixLevelFactory { get; set; }

    internal InnerStorageLensActivityMetricsFactory ActivityMetricsFactory { get; set; }

    internal InnerStorageLensAdvancedCostOptimizationMetricsFactory AdvancedCostOptimizationMetricsFactory { get; set; }

    internal InnerStorageLensDetailedStatusCodesMetricsFactory DetailedStatusCodesMetricsFactory { get; set; }

    protected override Humidifier.S3.StorageLensTypes.BucketLevel Create()
    {
        var bucketLevelResult = CreateBucketLevel();
        factoryAction?.Invoke(bucketLevelResult);

        return bucketLevelResult;
    }

    private Humidifier.S3.StorageLensTypes.BucketLevel CreateBucketLevel()
    {
        var bucketLevelResult = new Humidifier.S3.StorageLensTypes.BucketLevel();

        return bucketLevelResult;
    }
    public override void CreateChildren(Humidifier.S3.StorageLensTypes.BucketLevel result)
    {
        base.CreateChildren(result);

        result.AdvancedDataProtectionMetrics ??= AdvancedDataProtectionMetricsFactory?.Build();
        result.PrefixLevel ??= PrefixLevelFactory?.Build();
        result.ActivityMetrics ??= ActivityMetricsFactory?.Build();
        result.AdvancedCostOptimizationMetrics ??= AdvancedCostOptimizationMetricsFactory?.Build();
        result.DetailedStatusCodesMetrics ??= DetailedStatusCodesMetricsFactory?.Build();
    }

} // End Of Class

